Seria legal ver um vídeo do Jazz capturando os lendários que pedem pra ele nos comentários, só que não é tão fácil encontrar um lendário quanto parece.


1°, Você precisa estar no bioma em que o lendário / mítico que você quer apareça;


2°, Precisa de Pokémons muito fortes, pq os lendários spawnam no LvL 70, e os míticos, no 50;


3°, Você tem que tomar o maior cuidado do mundo pra não matar eles sem querer com um ataque muito forte;


e 4°, A chance de um lendário / mítico aparecer é muito baixa, às vezes vc fica 3 horas e não aparece nenhum.

