Não sei se isso é bom:
Eu criei um novo mundo para jogar Pixelmon, mas aí apareceu um Pikachu e eu sempre pego 5 pokeballs de início, capturei ele na segunda tentativa, depois achei uma Extreme Hills+ e nela achei um Larvitar Lvl. 8, acabei matando ele com meu Froakie ;-;
Depois achei outro Larvitar Lvl. 9 e capturei, depois fiquei fazendo uma farm de Apricorns e achei um Riolu Lvl. 5, e capturei de primeira, depois procurei uma Savana para achar um Growlithe, depois meus pais falaram que a gente ia sair, aí a gente saiu, voltamos meia hora depois, e quando voltei tinha UM MONTE DE MEGA EVOLUÇÃO DO SCIZOR ( não lembro o nome ), KANGHASKAN SHINY, depois eles sumiram e eu achei um Growlithe.
